    'help.HowLongWillMyPostingAppearOnBrand_contentNew': '\u0CAA\u0CCD\u0CB0\u0CB8\u0CCD\u0CA4\u0CC1\u0CA4 OLX \u0CA8\u0CB2\u0CCD\u0CB2\u0CBF \u0C86\u0C97\u0CBF\u0CB0\u0CC1\u0CB5 \u0CAA\u0CCB\u0CB8\u0CCD\u0C9F\u0CCD \u0C97\u0CB3\u0CC1 <<NUMBER>> \u0CA6\u0CBF\u0CA8\u0C97\u0CB3 \u0CA8\u0C82\u0CA4\u0CB0 \u0CAE\u0CC1\u0C95\u0CCD\u0CA4\u0CBE\u0CAF\u0CB5\u0CBE\u0C97\u0CC1\u0CA4\u0CCD\u0CA4\u0CA6\u0CC6. \u0CA8\u0C82\u0CA4\u0CB0, \u0CAA\u0CCB\u0CB8\u0CCD\u0C9F\u0CCD \u0C97\u0CB3\u0CA8\u0CCD\u0CA8\u0CC1 \u0CB8\u0CC8\u0C9F\u0CCD \u0CA8\u0CBF\u0C82\u0CA6 \u0CA4\u0CC6\u0C97\u0CC6\u0CA6\u0CC1 \u0CB9\u0CBE\u0C95\u0CB2\u0CBE\u0C97\u0CC1\u0CA4\u0CCD\u0CA4\u0CA6\u0CC6. \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0C90\u0C9F\u0C82 \u0CAE\u0CBE\u0CB0\u0CBE\u0C9F \u0C86\u0CA6 \u0CA8\u0C82\u0CA4\u0CB0 \u0C9C\u0CBE\u0CB9\u0CC0\u0CB0\u0CBE\u0CA4\u0CC1\u0C97\u0CB3\u0CA8\u0CCD\u0CA8\u0CC1 \u0CB8\u0CC8\u0C9F\u0CBF\u0CA8\u0CBF\u0C82\u0CA6 \u0CA4\u0CC6\u0C97\u0CC6\u0CA6\u0CC1 \u0CB9\u0CBE\u0C95\u0CC1\u0CB5\u0CC1\u0CA6\u0CC1 \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0C9C\u0CB5\u0CBE\u0CAC\u0CCD\u0CA6\u0CBE\u0CB0\u0CBF, \u0C87\u0CB2\u0CCD\u0CB2\u0CA6\u0CBF\u0CA6\u0CCD\u0CA6\u0CB0\u0CC6 \u0C85\u0CA6\u0CC1 \u0CAE\u0CC1\u0C95\u0CCD\u0CA4\u0CBE\u0CAF \u0CA6\u0CBF\u0CA8\u0CBE\u0C82\u0C95 \u0CA8\u0C82\u0CA4\u0CB0 \u0CB8\u0CCD\u0CB5\u0CAF\u0C82\u0C9A\u0CBE\u0CB2\u0CBF\u0CA4\u0CB5\u0CBE\u0C97\u0CBF \u0CA4\u0CC6\u0C97\u0CC6\u0CA6\u0CC1\u0CB9\u0CBE\u0C95\u0CB2\u0CBE\u0C97\u0CC1\u0CA4\u0CCD\u0CA4\u0CA6\u0CC6. \u0CA8\u0CBF\u0CD5\u0CB5\u0CC1 \u0C87\u0CA8\u0CCD\u0CA8\u0CC2 \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0C90\u0C9F\u0C82\u0CA8\u0CCD\u0CA8\u0CC1 \u0CA8\u0CC0\u0CA1\u0CC1\u0CA4\u0CCD\u0CA4\u0CBF\u0CA6\u0CCD\u0CA6\u0CB0\u0CC6 \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0C9C\u0CBE\u0CB9\u0CC0\u0CB0\u0CBE\u0CA4\u0CA8\u0CCD\u0CA8\u0CC1 \u0CA4\u0CC6\u0C97\u0CC6\u0CA6\u0CC1 \u0CB9\u0CBE\u0C95\u0CBF\u0CA6 \u0CA8\u0C82\u0CA4\u0CB0\u0CB5\u0CC2 \u0CAE\u0CB0\u0CC1 \u0CAA\u0CCB\u0CB8\u0CCD\u0C9F\u0CCD \u0CAE\u0CBE\u0CA1\u0CAC\u0CB9\u0CC1\u0CA6\u0CC1.',
