    'featured_listings.HowDoIBuyAFeaturedListing_New': '\u0CA8\u0CA8\u0CCD\u0CA8 \u0CA8\u0CA8\u0CCD\u0CA8 OLX \u0CA8\u0CBF\u0C82\u0CA6 \u0C85\u0CA5\u0CB5\u0CBE \u0CAA\u0CCB\u0CB8\u0CCD\u0C9F\u0CBF\u0C82\u0C97\u0CCD \u0CAA\u0CCD\u0CB0\u0CCB\u0CB8\u0CC6\u0CB8\u0CCD \u0CA8 \u0C95\u0CCA\u0CA8\u0CC6\u0CAF \u0CB9\u0C82\u0CA4 \u0CAF\u0CBE\u0CB5\u0CC1\u0CA6\u0CC1 \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0C9C\u0CBE\u0CB9\u0CC0\u0CB0\u0CBE\u0CA4\u0CC1 \u0CAA\u0CCD\u0CB0\u0C95\u0C9F\u0CB5\u0CBE\u0C97\u0CBF\u0CA6\u0CC6\u0CAF\u0CC6\u0C82\u0CA6\u0CC1 \u0CA6\u0CC3\u0CA2\u0CAA\u0CA1\u0CBF\u0CB8\u0CC1\u0CA4\u0CCD\u0CA4\u0CA6\u0CCB \u0C85\u0CA6\u0CB0\u0CBF\u0C82\u0CA6 \u0CA8\u0CC0\u0CB5\u0CC1 \u0CAA\u0CCD\u0CB0\u0CA6\u0CB0\u0CCD\u0CB6\u0CBF\u0CA4\u0CB5\u0CBE\u0CA6 \u0C9C\u0CBE\u0CB9\u0CC0\u0CB0\u0CBE\u0CA4\u0CA8\u0CCD\u0CA8\u0CC1 \u0C96\u0CB0\u0CBF\u0CD5\u0CA6\u0CBF\u0CB8\u0CAC\u0CB9\u0CC1\u0CA6\u0CC1. \u0C88 \u0CAA\u0CCD\u0CB0\u0CCB\u0CB8\u0CC6\u0CB8\u0CCD\u0CB8\u0CC1 \u0CA8\u0CC7\u0CB0\u0CB5\u0CBE\u0C97\u0CBF\u0CA6\u0CC6. \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0C9C\u0CBE\u0CB9\u0CC0\u0CB0\u0CBE\u0CA4\u0CA8\u0CCD\u0CA8\u0CC1 \u0C8E\u0CB7\u0CCD\u0C9F\u0CC1 \u0CB5\u0CBE\u0CB0\u0C97\u0CB3\u0CB5\u0CB0\u0CC6\u0C97\u0CC6 \u0CA4\u0CCB\u0CB0\u0CBF\u0CB8\u0CB2\u0CC1 \u0CAC\u0CAF\u0CB8\u0CC1\u0CB5\u0CB7\u0CCD\u0C9F\u0CC1 \u0C86\u0CAF\u0CCD\u0C95\u0CC6 \u0CAE\u0CBE\u0CA1\u0CAC\u0CB9\u0CC1\u0CA6\u0CC1. \u0CA8\u0C82\u0CA4\u0CB0 \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE\u0CA8\u0CCD\u0CA8\u0CC1 \u0CAA\u0CBE\u0CB5\u0CA4\u0CBF \u0C86\u0CAF\u0CCD\u0C95\u0CC6\u0C97\u0CC6 \u0CB5\u0CBF\u0CB5\u0CBF\u0CA7 \u0CAA\u0CBE\u0CB5\u0CA4\u0CBF \u0CAA\u0CC1\u0C9F\u0C95\u0CCD\u0C95\u0CC6 \u0C92\u0CAF\u0CCD\u0CAF\u0CB2\u0CBE\u0C97\u0CC1\u0CA4\u0CCD\u0CA4\u0CA6\u0CC6. \u0CAA\u0CBE\u0CB5\u0CA4\u0CBF\u0CB8\u0CBF\u0CA6 \u0CA8\u0C82\u0CA4\u0CB0, \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0C9C\u0CBE\u0CB9\u0CC0\u0CB0\u0CBE\u0CA4\u0CC1 \u0C86\u0CAF\u0CCD\u0C95\u0CC6\u0CAF\u0CBE\u0CA6 \u0CB8\u0CAE\u0CAF\u0CA6\u0CB5\u0CB0\u0CC6\u0C97\u0CC2 \u0CA6\u0CCA\u0CB0\u0C95\u0CC1\u0CB5 \u0CA6\u0CC3\u0CA2\u0CA4\u0CC6\u0CAF\u0CA8\u0CCD\u0CA8\u0CC1 \u0CA8\u0CC0\u0CB5\u0CC1 \u0CAA\u0CA1\u0CC6\u0CAF\u0CC1\u0CB5\u0CBF\u0CB0\u0CBF. \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0C9C\u0CBE\u0CB9\u0CC0\u0CB0\u0CBE\u0CA4\u0CC1 OLX \u0CAC\u0CB3\u0C95\u0CC6\u0CAF \u0CAA\u0CA6\u0C97\u0CB3\u0CBF\u0C97\u0CC6 \u0CAC\u0CA6\u0CCD\u0CA7\u0CB5\u0CBE\u0C97\u0CBF\u0CA6\u0CCD\u0CA6\u0CB0\u0CC6, \u0CA8\u0CC0\u0CB5\u0CC1 \u0CA6\u0CC3\u0CA2\u0CA4\u0CC6\u0CAF\u0CA8\u0CCD\u0CA8\u0CC1 \u0C87-\u0CAE\u0CC7\u0CB2\u0CCD \u0CA8\u0CB2\u0CCD\u0CB2\u0CBF \u0CAA\u0CA1\u0CC6\u0CAF\u0CC1\u0CB5\u0CBF\u0CB0\u0CBF. \u0CA8\u0CC0\u0CB5\u0CCA\u0C82\u0CA6\u0CC1 \u0CAA\u0CCD\u0CB0\u0CA6\u0CB0\u0CCD\u0CB6\u0CBF\u0CA4\u0CB5\u0CBE\u0CA6 \u0C9C\u0CBE\u0CB9\u0CC0\u0CB0\u0CBE\u0CA4\u0CA8\u0CCD\u0CA8\u0CC1 \u0C96\u0CB0\u0CC0\u0CA6\u0CBF\u0CB8\u0CBF\u0CA6 \u0CA8\u0C82\u0CA4\u0CB0 \u0CAF\u0CBE\u0CB5\u0CC1\u0CA6\u0C82 \u0CB0\u0CC0\u0CA4\u0CBF\u0CAF\u0CB2\u0CCD\u0CB2\u0CBF \u0CB9\u0CBF\u0C82\u0CA4\u0CBF\u0CB0\u0CC1\u0C97\u0CBF\u0CB8\u0CB2\u0CBE\u0C97\u0CC1\u0CB5\u0CC1\u0CA6\u0CBF\u0CB2\u0CCD\u0CB2\u0CB5\u0CC6\u0C82\u0CAC\u0CC1\u0CA6\u0CA8\u0CCD\u0CA8\u0CC1 \u0C97\u0CAE\u0CA8\u0CA6\u0CB2\u0CCD\u0CB2\u0CBF\u0CA1\u0CBF. \u0CAA\u0CCD\u0CB0\u0CA6\u0CB0\u0CCD\u0CB6\u0CBF\u0CA4\u0CB5\u0CBE\u0CA6 \u0C9C\u0CBE\u0CB9\u0CC0\u0CB0\u0CBE\u0CA4\u0CBF\u0CA8 \u0C8E\u0CB2\u0CCD\u0CB2\u0CBE \u0CAE\u0CBE\u0CB0\u0CBE\u0C9F\u0CB5\u0CC1 \u0C85\u0C82\u0CA4\u0CBF\u0CAE\u0CB5\u0CBE\u0C97\u0CBF\u0CA6\u0CC6.',
